// src/pages/Contact.jsx
import React from "react";
import { Link } from "react-router-dom";
import Navbar from "../components/Navbar";
import styled from "styled-components";
import XR from "../assets/xr.png";
import CG from "../assets/cg.png"
import APP from "../assets/app.png";
import iOS from "../assets/iOS.png";

const Contact = () => {
  return (
    <Container>
        <CommonNav>
        <NavLink to="/">Home</NavLink>
        <NavLink to="/aboutme">About Me</NavLink>
        <NavLink to="/contact">Contact</NavLink>
      </CommonNav>
      <Content>
        <h2>If anyone is interested in these parts, please contact me!</h2>
        <InterestSection>
            <figure>
                <img src={XR} alt="XR"/>
                <figcaption>XR</figcaption>
            </figure>
            <figure>
                <img src={CG} alt="CG"/>
                <figcaption>CG</figcaption>
            </figure>
            <figure>
                <img src={APP} alt="APP"/>
                <figcaption>APP</figcaption>
            </figure>
            <figure>
                <img src={iOS} alt="iOS"/>
                <figcaption>iOS</figcaption>
            </figure>
        </InterestSection>
        <ContactInfo>
          <h2>ðŸ©µ HOW TO CONTACT ðŸ©µ</h2>
          <p>Phone: 010-6249-1743</p>
          <p>Email: leg040311@gmail.com</p>
          <p>Kakaotalk ID: iameunji_</p>
          <p>Location: 310 Building 7th floor</p>
        </ContactInfo>
      </Content>
    </Container>
  );
};

export default Contact;

const Container = styled.div`
  padding: 20px;
`;

const CommonNav = styled.nav`
  position: relative;
  display: flex;
  top: 10px;
  justify-content: space-around;
  background-color: rgba(26, 126, 207, 0.6);
  border-radius: 10px;
  padding: 5px;
  margin-bottom: 20px;
`;

const NavLink = styled(Link)`
  text-decoration: none;
  color: #fffff0;
  font-size: 23px;
  font-family: "Dosis", sans-serif;

  &:hover {
    font-weight: bold;
    font-style: italic;
  }
`;

const Content = styled.div`
  text-align: center;

  h2 {
    margin-top: 40px;
  }
`;

const InterestSection = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-evenly;
  margin-bottom: 40px;
`;

const Figure = styled.figure`
  text-align: center;
  margin: 20px;

  img {
    width: 120px;
    object-fit: cover;
  }

  figcaption {
    margin-top: 15px;
    font-size: 19px;
    color: rgb(26, 126, 207);
  }
`;

const ContactInfo = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  text-align: left;
  gap: 10px;

  h2 {
    margin-bottom: 10px;
  }

  p {
    font-size: 19px;
    margin: 10px;
    width: 300px;
  }
`;
